         </div>
      </div>
        <div className="col-10 mx-auto col-lg-2">
        	<span className="d-lg-none">MNT : </span>
        	{menteepower}
        </div>

      	<div className="col-10 mx-auto col-lg-2">
         <div className="cart-icon" onClick={()=> removeUser(id)}>
         <i className="fas fa-trash"></i>
         </div>
         </div>


     </div>
     </MyContainer>
    );
  }


export default NetworkUser

